class Vendor{
    constructor(vendorid,vendorname,verified,address,city,pincode,state)
    {
        this.vendorid=vendorid;
        this.vendorname=vendorname;
        this.verified=verified;
        this.address=address;
        this.city=city;
        this.pincode=pincode;
        this.state=state;
    }
}


export default Vendor;